import logo from './logo.svg';
import './App.css';

console.log("App component running");

const title = {
  title: 'My Main Title',
  subtitle: 'My Sub Title',
  list: [
    'list Item 1',
    'list Itme 2'
  ]
}
let list = "";
for(let l of title.list){
  list += l;
}
console.log(list);

 function App() {
  return (
    <div>
      <h1>{title.title}</h1>
      <p>{title.subtitle}</p>
      <ol>
        <li>{list}</li>
      </ol>
    </div>
  );
}

const user = {
  name: 'Gee',
  age: '40',
  location: "Los Angeles"
};

// const userName = "Jordan";
// const userAge = "27";
// const userLocation = "SF";

function getLocation(location){
  if(location){
    return location;
  }
  else{
    return 'Unknown';
  }
}

 function TemplateTwo(){
  return(
    <div>
      <h1>{user.name}</h1>
      <p>Age: {user.age}</p>
      <p>Location: {getLocation(user.location)}</p>
    </div>
  );
}

//Render Default
export default TemplateTwo;
